import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Pages
import Home from './pages/Home';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Profile from './pages/Profile';
import Booking from './pages/Booking';
import BookingHistory from './pages/BookingHistory';
import ParkingDetails from './pages/ParkingDetails';
import SearchParking from './pages/SearchParking';
import Confirmation from './pages/Confirmation';
import ExtendParking from './pages/ExtendParking';
import Favorites from './pages/Favorites';
import PaymentMethods from './pages/PaymentMethods';
import ForgotPassword from './pages/ForgotPassword';

function App() {
  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/search" element={<SearchParking />} />

        {/* Booking Routes */}
        <Route path="/booking" element={<Booking />} />
        <Route path="/booking/confirm" element={<Confirmation />} />
        <Route path="/booking/extend/:id" element={<ExtendParking />} />
        <Route path="/booking/history" element={<BookingHistory />} />
        <Route path="/parking/:id" element={<ParkingDetails />} />

        {/* User Account Routes */}
        <Route path="/profile" element={<Profile />} />
        <Route path="/favorites" element={<Favorites />} />
        <Route path="/payment-methods" element={<PaymentMethods />} />
      </Routes>
    </Router>
  );
}

export default App;
